//vjti.ac.in/",desc:"Victoria Jubilee Technical Institute or VJTI Mumbai, established in 1887 and is affiliated with the University of Mumbai. The institute was renamed Veermata Jijabai Technological Institute (VJTI) and is owned by Maharashtra State Government. It is one of the 14 institutes selected by the Central Government for development in Engineering education post-independence with grant-in-aid from the Centre. It was ranked 82 for Engineering by NIRF in 2021. It has been recognised by AICTE as the Quality Improvement Programme (QIP) centre since 2012.\n\nVJTI offers undergraduate, postgraduate, diploma, and research programme and the courses include BTech, MTech, MCA, PhD, etc. There has been a set-up of Distance Education Programmes with IIT with VJTI as a Remote Centre.",img1:"IMG_2.1.jpg",img2:"IMG_2.2.jpg",brochure:"brochure_2.pdf"},{rank:3,code:3215,name:"Bhartiya Vidya Bhavan's Sardar Patel Institute of Technology , Andheri, Mumbai",university:"Mumbai University",status:"Un-Aided",at_status:"Autonomous",degree:"B.Tech",location:"Mumbai",fee_cat:"1 LAKH - 2 LAKH",fee:"1,70,000",etc:1,cse:1,cutoff_desc:"Computer Engineering - 99.70\nElectronics and Telecommunication Engg - 98.80 \nComputer Science and Engineering(Artificial Intelligence and Machine Learning) - 99.53\nComputer Science and Engineering(Data Science) - 99.43",url:"https://www.spit.ac.in/",desc:"Sardar Patel Institute of Technology, Mumbai was established in 1962. Sardar Patel Institute of Technology is affiliated with Mumbai University. It is a self-funded college and the best among the engineering colleges in India. The college offers 12 courses under two streams including IT & Software and Engineering. It has seven departments including Electronics Engineering, Information Technology, Computer Engineering, and Applied Science & Humanities. The top courses offered through these departments are BTech, MTech, MCA, PhD, and PGD-UX Design. The campus area is 47 Acre covered with green surroundings. The Sardar Patel Institute of Technology has various committees such as Grievance Committee, Governing Body Committee, Internal Complaints Committee, and Statutory & Non- statuary committee.",img1:"IMG_3.1.jpg",img2:"IMG_3.2.jpg",brochure:"brochure_3.pdf"},{rank:4,code:6271,name:"Pune Institute of Computer Technology, Dhankavdi, Pune",university:"Savitribai Phule Pune University",status:"Un-Aided",at_status:"Non-Autonomous",degree:"B.E.",location:"Pune",fee_cat:"< 1 LAKH",fee:91500,etc:1,cse:1,it:1,cutoff_desc:"\nComputer Engineering\nHome University Seats Allotted to Home University Candidates - 99.59\nOther Than Home University Seats Allotted to Other Than Home University Candidates - 99.63\nState Level - 98.12\n\nElectronics and Telecommunication Engg \nHome University Seats Allotted to Home University Candidates - 97.94                                                                                       Other Than Home University Seats Allotted to Other Than Home University Candidates - 98.63\nState Level - 94.59\n\nInformation Technology \nHome University Seats Allotted to Home University Candidates - 99.15\nOther Than Home University Seats Allotted to Other Than Home University Candidates - 99.47\nState Level - 97.36",url:"https://pict.edu/",desc:"PICT Pune is a private college affiliated with\xa0Savitribai Phule Pune University\xa0and is ranked in the 201-250 band in NIRF's India rankings. PICT was established in 1983 and is approved by the AICTE, Directorate of Technical Education Maharashtra, and is accredited by NAAC. All its UG programmes are accredited with an A grade by the NBA. The college has four departments providing three UG courses, four PG courses, and two PhD programmes across Science and Engineering streams. The college conducts eligibility tests like AMCAT and various training sessions as a part of placements assistance. In the ongoing placement process, it was noticed that 532 students got placed and an average package of INR 10.56 LPA was offered to the selected candidates.",img1:"IMG_4.1.jpg",img2:"IMG_4.2.jpg",brochure:"brochure_4.pdf"},{rank:5,code:3036,name:"Institute of Chemical Technology, Matunga, Mumbai",university:"Deemed to be University",status:"Deemed University",at_status:"Autonomous",degree:"B.E.",location:"Mumbai",fee_cat:"< 1 LAKH",fee:85350,chem:1,cutoff_desc:"Chemical Engineering - 99.32\nDyestuff Technology - 96.96\nOil,Oleochemicals and Surfactants Technology - 97.43\nPharmaceuticals Chemistry and Technology - 98.28\nFibres and Textile Processing Technology - 94.69\nPolymer Engineering and Technology- 98.73\nFood Engineering and Technology - 98.47\nSurface Coating Technology - 97.36",url:"https://www.ictmumbai.edu.in/",desc:"Also known as ICT Mumbai, the Institute of Chemical Technology, Mumbai is an institution of higher education that is purely publicly funded. It was established in 1933 as the University Department of Chemical Technology, a constituent of the University of Bombay. It received the Deemed-to-be-University status by the Ministry of Human Resource Development (MHRD), Govt. of India in 2008 under Section 3 of UGC Act 1956. It holds NAAC grade \u2018A++' accreditation and recognition from the University Grants Commission (UGC). The courses offered at ICT Mumbai are approved by the National Board of Accreditation (NBA).",img1:"IMG_5.1.jpg",img2:"IMG_5.2.jpg",brochure:"brochure_5.pdf"},{rank:6,code:3199,name:"Shri Vile Parle Kelvani Mandal's Dwarkadas J. Sanghvi College of Engineering, Vile Parle,Mumbai",university:"Mumbai University",status:"Un-Aided",at_status:"Autonomous",degree:"B.Tech",location:"Mumbai",fee_cat:"1 LAKH - 2 LAKH",fee:"1,90,000",etc:1,cse:1,mechanical:1,it:1,ai:1,cutoff_desc:"Computer Engineering - 99.09\nMechanical Engineering - 94.61\nInformation Technology - 98.48\nArtificial Intelligence (AI) and Data Science - 97.94\nComputer Science and Engineering(Data Science) - 98.23\nComputer Science and Engineering (Internet of Things and Cyber Security Including Block Chain\nTechnology) - 97.63\nArtificial Intelligence and Machine Learning - 98.23\nElectronics and Telecommunication Engg - 96.31",url:"https://www.djsce.ac.in/Overview/M__125",desc:"Dwarkadas Jivanlal Sanghvi College of Engineering is located in Mumbai, Maharashtra and was established in 1994 by the Shri Vile Parle Kelavani Mandal\u2019s Trust. It is affiliated to the University of Mumbai and approved by the All India Council for Technical Education (AICTE). All the undergraduate programs are accredited by the NBA and also accredited by the NAAC with an \u201cA\u201d Grade. It is one of the few colleges in Maharashtra to receive \u2018A\u2019 Grade certificate from the Directorate of Technical Education, Maharashtra State.\n\nIt has been ranked in top 10 Private Engineering Institutions of the country and ranked as the \u201cBest Private Engineering College\u201d in the western region of the country by India Today. The college offers nine undergraduate, three post graduate and three PhD courses.\n\nIt has well-equipped laboratories, workshops and well-stocked library provide a stimulating educational environment to the students . Library is fully air-conditioned and well-furnished with an area of more than 7500 sq. ft. It is facilitated with reprography and 24-hour wi-fi network connection.",img1:"IMG_6.1.jpg",img2:"IMG_6.2.jpg",brochure:"brochure_6.pdf"},{rank:7,code:3181,name:"K.J.Somaiya College of Engineering, Vidyavihar, Mumbai",university:"Mumbai University",status:"Un-Aided",at_status:"Autonomous",degree:"B.Tech",location:"Mumbai",fee_cat:"3 LAKH - 4 LAKH",fee:"3,45,000",url:"https://kjsce.somaiya.edu/en",img1:"IMG_7.1.jpg",img2:"IMG_7.2.jpg",brochure:"brochure_7.pdf"},{rank:8,code:6007,name:"Walchand College of Engineering, Sangli",university:"Shivaji University",status:"Government-Aided",at_status:"Autonomous",degree:"B.Tech",location:"Sangli",fee_cat:"< 1 LAKH",fee:85665,etc:1,cse:1,civil:1,electrical:1,mechanical:1,it:1,cutoff_desc:"Mechanical Engineering - 96.92\nInformation Technology - 98.94\nComputer Science and Engineering - 99.29\nElectronics Engineering - 97.77\nCivil Engineering - 94.60\nElectrical Engineering - 96.52",url:"http://www.walchandsangli.ac.in/",desc:"Walchand College of Engineering (WCE) was established in 1947 and is located in Vishrambag, Sangli, Maharashtra. This college started with an undergraduate course in Civil Engineering and a capacity of 60 students. It is approved by the All India Council for Technical Education (AICTE) and is recognised by the National Assessment and Accreditation Council (NAAC) and the National Board of Accreditation (NBA).\nWCE offers undergraduate and graduate courses in the field of Engineering. The highly popular branches out of the total 17 available courses here are Computer Science & Engineering, Mechanical Engineering, and Civil Engineering. Each course has about 60 students with a few branches having more students, and the faculty to student ratio is approximately 1:70. The Walchand College of Engineering has dedicated departments of Physics, Chemistry, Math, IT, Mechanical, etc., to aid the basic learning of its students. It also provides its students with a huge library along with reading rooms. Hostel facilities are also provided with good infrastructure and mess facilities. Besides these, dedicated laboratories for required courses are available as well.\n\nThe WCE also has research tie ups with various national and international organisations. The Electronics Engineering department is engaged in Agricultural and Automotive Research in collaboration with John Deere while the Computer Science and Engineering department is in collaboration with IIT Bombay for High Power Computing projects.",img1:"IMG_8.1.jpg",img2:"IMG_8.2.jpg",brochure:"brochure_8.pdf"},{rank:9,code:6273,name:"Bansilal Ramnath Agarawal Charitable Trust's Vishwakarma Institute of Technology, Bibwewadi, Pune",university:"Savitribai Phule Pune University",status:"Un-Aided",at_status:"Autonomous",degree:"B.E.",location:"Pune",fee_cat:"1 LAKH - 2 LAKH",fee:"1,65,000",etc:1,cse:1,electrical:1,mechanical:1,it:1,ai:1,instrumental:1,chem:1,cutoff_desc:"Mechanical Engineering - 93.36\nInformation Technology - 98.64\nComputer Engineering - 98.80\nElectronics and Telecommunication Engg - 96.37\nElectrical Engineering - 96.52\nInstrumentation and Control Engineering - 87.18\nChemical Engineering - 86.76\nArtificial Intelligence and Data Science - 97.56",url:"https://www.vit.edu/",desc:"Vishwakarma Institute of Technology is located in Pune and is approved by AICTE. VIT Pune has been ranked 122 in the Engineering category by NIRF 2021 and ranked 12 as private Engineering college by The Week survey 2021.\n\nVIT Pune provides undergraduate and postgraduate programmes under 10 departments like Chemical Engineering, Computer Engineering, Electronics & Telecommunication Engineering, Engineering, Science and Humanities, Industrial & Production Engineering, Instrumentation Engineering, Information Technology, Mechanical Engineering, Artificial Intelligence & Data Science, and Master in Computer Application. The courses include BTech, MTech, MCA, PhD, etc.",img1:"IMG_9.1.jpg",img2:"IMG_9.2.jpg",brochure:"brochure_9.pdf"},{rank:10,code:6796,name:"Bharati Vidyapeeth's College of Engineering,Lavale, Pune",university:"Savitribai Phule Pune University",status:"Un-Aided",at_status:"Non-Autonomous",degree:"B.E.",location:"Pune",fee_cat:"< 1 LAKH",fee:98966,etc:1,cse:1,civil:1,mechanical:1,cutoff_desc:"\nCivil Engineering\nHome University Seats Allotted to Home University Candidates - 3.58\nHome University Seats Allotted to Other Than Home University Candidates - 52.01\nOther Than Home University Seats Allotted to Other Than Home University Candidates - 70.39\nState Level - 7.07(EWS)\n\nComputer Engineering\nHome University Seats Allotted to Home University Candidates - 93.57                                                     \nHome University Seats Allott